    "legend": [
        {
            "data": [
                "[\u539f\u795e \u8ba8\u8bba\u4e13\u697c\uff08\u7981\u6b62\u65b0\u5f00\u8ba8\u8bba\uff09]",
                "[\u3010\u660e\u65e5\u65b9\u821f\u3011\u60c5\u62a5\u6c47\u603b\u4e13\u697c S1\u7fa4\u53f7\uff1a159430936 \u3010\u5df2\u66f4\u65b0\u4e09\u6d4b\u76f8\u5173]",
                "[FF14 \u8ba8\u8bba\u8d34 5.2\u6536\u85cf\u54c1\u91d1\u5e01\u8981\u780d\u4e86\uff5e]",
                "[\u300a\u6b7b\u4ea1\u6401\u6d45\u300b\u7efc\u5408\u8ba8\u8bba\u8d34 \uff5c \u5de5\u4f5c\u5ba4\u56db\u5468\u5e74 \uff5c \u5723\u8bde\u5f69\u86cb]",
                "[\u6cf0\u5766\u5929\u964d2 \uff08Titanfall2\uff09\u4e13\u697c\uff08 \u8f6c\u578bApex Legend\u4e13\u697c\uff09]",
                "\uff0f\uff0a\u8ba8\u8bba\u697c\uff0a\uff0f\u3010\u738b\u56fd\u4e4b\u5fc33\u3011DLC\u5df2\u63a8\u51fa\uff01",
                "[P\u793e\u6700\u65b0\u7b56\u7565\u6e38\u620f-Stellaris\uff0f\u7fa4\u661f - dlc\u5de8\u578b\u4f01\u4e1a\u89e3\u9501\u8fd8\u6709\u5b98\u4e2d]",
                "\u3010\u661f\u9645\u6bd4\u8d5b\u697c\u3011\u5df2\u5f00\u65b0\u697c\uff0c\u866b\u6d1e\u6362\u5bb6\u4e86",
                "200-\u3010\u5b9d\u53ef\u68a6\u5251\u76fe\u3011\u4e13\u697c,\u300a\u6269\u5c55\u7968\u94e0\u5c9b\u300b\u9884\u7ea6\u5f00\u653e,+\u7cbe\u7075\u5bf9\u6218\u5f52\u6765\u514d\u8d39\u66f4\u65b0,\u4e25\u7981\u5267\u900f\u89e3\u5305-1\u9875",
                "\u300a\u53ea\u72fc \u5f71\u901d\u4e8c\u5ea6\u300b\u8ba8\u8bba\u697c \u30101.03\u8865\u4e01\u3011\u4ed9\u5cf0\u811a\u60e8\u906d\u524a\u5f31",
                "leileleile\uff0cP5R\u6765\u4e86-1\u9875",
                "\u7687\u724c\u7a7a\u62187\u4e13\u697c\u2014\u2014OST\u5730\u5740\u66f4\u65b0\uff0c\u611f\u8c22\u575b\u53cbwfhtony-1\u9875",
                "[\u5d29\u574f3rd\u4e13\u697c  ios\u5b89\u5353\u90fd\u53ef\u4ee5\u73a9\u5566\uff01\uff01\uff01\uff01\uff01]",
                "[\u3010\u5b9d\u53ef\u68a6\u5251\u76fe\u3011\u4e13\u697c,\u300a\u6269\u5c55\u7968\u94e0\u5c9b\u300b\u9884\u7ea6\u5f00\u653e,200+\u7cbe\u7075\u5bf9\u6218\u5f52\u6765\u514d\u8d39\u66f4\u65b0,\u4e25\u7981\u5267\u900f\u89e3\u5305]",
                "[\u4e09\u56fd\u5fd714\u516c\u5e03\u4e86\uff0c\u9500\u91cf\u7a81\u783420\u4e07]",
                "[Granblue Fantasy \u8ba8\u8bba\u5e16\uff08\u7981\u6b62\u975e\u6e38\u620f\u76f8\u5173\uff09]",
                "\u5f02\u5ea6\u795e\u52512\uff0fXenoblade 2\u516c\u5e03\uff0c2017\uff0f12\uff0f01\u5168\u7403(\u5b98\u65b9\u4e2d\u6587\u7248)\u540c\u6b65\u53d1",
                "[\u75c5\u680b\u4e00\u5468\u5e74]",
                "[PS4\uff0fNS\uff0fPC\u300aSD\u9ad8\u8fbeG\u4e16\u7eaa \u706b\u7ebf\u7eb5\u6a2a\u300b\u4e13\u697c\uff0c\u73b0\u5df2\u53d1\u552e]",
                "[Fate\uff0fGrand Order FGO\u56fd\u670d\u4e13\u697c 3\uff0f25 Homunculus and Master]",
                "[\u56fd\u4ea7\u6218\u68cb\u300a\u5723\u5973\u6218\u65d7\u300b2019\u6625\u53d1\u552e]",
                "[\u300a\u6781\u9650\u7ade\u901f\uff1a\u5730\u5e73\u7ebf4\u300b\u8ba8\u8bba\u5e16\uff5cSteam\u666e\u901a\u7248\uffe5188\uff0c\u7ec8\u6781\u7248\uffe5333]",
                "\u4efb\u5929\u5802\u660e\u661f\u5927\u4e71\u6597SP\u4e13\u697c\uff0c\u8001\u7537\u4ebaTerry\u53c2\u6218",
                "[Falcom \u300a\u4f0a\u82cf9-\u602a\u4eba\u4e4b\u591c-\u300b \u4e2d\u6587\u7248\u5df2\u53d1\u552e \u5df2\u66f4\u65b0\u8865\u4e01]",
                "\u3010DOTA2\u3011The International 2019(TI9)\u4e13\u697c\uff0c\u8349\u53f0\u73ed\u5b50\u53cc\u51a0",
                "[TGA\u56db\u5956\u5f97\u4e3b\uff0c\u300aDisco Elysium\uff0f\u6781\u4e50\u8fea\u65af\u79d1\u300b\u8ba8\u8bba\u697c]",
                "[\u5a01\u5c14\u58eb\u8c1a\u8bed\u6709\u4e91\uff1a\u201c\u56fd\u738b\u8bf7\u4f60\u53bb\u5f53\u683c\u62c9\u6469\u6839\u4f2f\u7235\u201d]",
                "\u6ca1\u4eba\u5efa\u6211\u6765\u5427\u673a\u6838\u7f51\u771f\uff08\u770b\uff09\u7231\uff08\u620f\uff09\u697c",
                "[\u3010epic\u767d\u5ad6\u6307\u5357\u3011\u4eca\u5929\u7684\u767d\u7ed9\u662f\u706b\u70ac\u4e4b\u51492]",
                "[\u300e\u5f02\u5ea6\u795e\u5251\uff0fXenoblade Definitive Edition\u300f\u81ea\u7531\u8ba8\u8bba\u4e13\u697c \u672c\u65e5\u767a\u58f2]",
                "CA\u65b0\u4f5c \u5168\u9762\u6218\u4e89\uff1a\u4e09\u56fd",
                "[\u3010\u661f\u9645\u6bd4\u8d5b2\u53f7\u697c\u3011WESG]",
                "[\u5982\u9f997\uff0f\u9f8d\u304c\u5982\u304f7 \u5149\u3068\u95c7\u306e\u884c\u65b9 \u9500\u91cf40\u4e07\uff0c2\u5468\u76ee\u6536\u8d39DLC]",
                "[\u300aDisco Elysium\uff0f\u6781\u4e50\u8fea\u65af\u79d1\u300b\u4e13\u697cSteam\u590f\u4fc387\u3001\u7f8e\u672f+OST 52]",
